1	ABOUT	about	<h2>About Toursanak</h2>\r\n\r\n<p>Toursanak is an adventure travel experience with operations based in Phnom Penh and expanding outward. Programs are designed to encourage youth and adults to step out of their comfort zones. We are all about self-exploration, self-determination, self-development, while fostering team spirit and a collaborative mindset.</p>\r\n\r\n<p>We are an educational adventure company. We organize and customize trips for educational institutions and adventure lovers who want to explore hidden places and to learn about Cambodian culture.</p>\r\n\r\n<p>Our programs are designed and planned to bring our participants up close and personal in Cambodia. Day trips include visits to villages and communities off the beaten path. We provide new and interesting ways to experience the authentic Cambodia that few other tourists have the opportunity to see. We offer leadership programs and team building, family trips, camping and cycling adventures, in a mutually supportive setting where learning and discovery is an exchange between visitors and hosts.</p>\r\n\r\n<p>Our current ambition is to serve in the field of leadership experience and educational adventure as specialists in Cambodia and neighboring countries such as Laos, Thailand, Vietnam, and Nepal.</p>\r\n\r\n<p>A portion of the profits from our business goes to support young Cambodian startups through our partner organization Smallworld. We feel it is important because we know our peers are beaming with ideas and inspiration and everyone deserves an opportunity to discover their dreams.</p>\r\n\r\n<h2>Key Facts</h2>\r\n\r\n<p><strong>Toursanak</strong>&nbsp;was founded in December 2009 while Rithy Thul was cycling in Kep with Daniela Ruby Papi. Rithy was inspired by the program founded by his friend Daniela, and wanted to create his own adventure company that would also support Cambodian youth and culture. Rithy often led cycle trips for international groups and he wanted to provide something similar for Cambodiana as well that would promote a love of cycling and adventure while also educating participants about the culture and environment. The word Toursanakech in Khmer literally translates as &ldquo;study tour.&rdquo; His idea was to earn money from the international tours to provide similar opportunities for Cambodians.</p>\r\n\r\n<p>There were five trial trips organized by Toursanak prior to launching the tour company. In January 2013, Toursanak, finally publicly decide to run its own tours.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<h2>We are Inspired</h2>\r\n\r\n<ul>\r\n\t<li>\r\n\t<p><strong>Run the Dream</strong>&nbsp;was a ten day solo 314 km by Rithy to inspire and educate Cambodian youth about sports, physical challenges, and investing in a dream. The run began in Siem Reap on February 20th, 2012 and continued until March 2nd 2012 ending in Phnom Penh. This event helped raise media and attention toward Rithy&rsquo;s goal to energise and inspire other young Cambodians and helped launch the tour company.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p><strong>SmallWorld Cambodia</strong>&nbsp;is a collaborative workplace designed to ensure that passionate, business minded youth have access to an enjoyable and productive work environment. It serves as an education, networking, and small business resource and support center where students and budding entrepreneurs can learn and network with others to discuss, test, and launch new business ideas.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p><strong>KhmerTalks</strong>, Building Resources of Knowledge for Cambodia, builds online interactive educational video presentations in Khmer language to share knowledge and resources for the next generation.</p>\r\n\t</li>\r\n\t<li>\r\n\t<p>We also support an open source sharing and networking community known as&nbsp;<strong>Khmer Young Entrepreneurs</strong>. It is formed on the model of an open source computer software<strong>&nbsp;Linux</strong>&rsquo; combined with<strong>&nbsp;TED</strong>&lsquo;s philosophy &ldquo;Ideas Worth Sharing.&rdquo;</p>\r\n\t</li>\r\n\t<li>\r\n\t<p><strong>The PEPY Ride</strong>&nbsp;is an annual event by PEPY, an organization that is dedicated to increasing access of education to rural villages in Siem Reap. We love its model. Investing time in people.</p>\r\n\t</li>\r\n</ul>\r\n	2016-08-01 22:31:02.427027	1
