6	TOUL SLENG MUSEUM PHNOM PENH TOUR  	<p>Together we visit the Toul Svay Prey high school which was taken by Pol Pot&rsquo;s security and converted into the prison known as S-21 where thousands of people were executed and tortured. We will hire a tour guide to explain the history and significance of the dark but important historical site. We will have a discussion group after to reflect.</p>\r\n\r\n<table border="0" cellpadding="1" cellspacing="1" style="width:100%">\r\n\t<thead>\r\n\t\t<tr>\r\n\t\t\t<th scope="col">Tour info</th>\r\n\t\t\t<th scope="col">&nbsp;</th>\r\n\t\t</tr>\r\n\t</thead>\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td>Open</td>\r\n\t\t\t<td><br />\r\n\t\t\t- Duration: 1 to 1:30min<br />\r\n\t\t\t- Open: 7 to 11:30AM and 5 to 5:30PM<br />\r\n\t\t\t- Participant: 2 to 20 Max</td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n	Learning the dark period of Cambodia, S-21 museum, Pol Pot tortured prisoners	data:image/jpeg;base64,	toul-sleng-museum-phnom-penh-tour	1	30		20160801220015353706-toulsleng.jpg	1	2016-08-01 22:00:15.296553	2
3	COOKING CLASS PHNOM PENH  	<p>In this activity, we teach you how to cook famous Khmer dishes. This is a fun way to more fully appreciate the complexity of Khmer cuisine and to familiarize yourself with the raw ingredients. Plus, we get to eat the results of our labor!</p>\r\n\r\n<table border="0" cellpadding="1" cellspacing="1" style="width:100%">\r\n\t<thead>\r\n\t\t<tr>\r\n\t\t\t<th scope="col">Tour info</th>\r\n\t\t\t<th scope="col">&nbsp;</th>\r\n\t\t</tr>\r\n\t</thead>\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td>Participants</td>\r\n\t\t\t<td>- Duration: 3h<br />\r\n\t\t\t- Participant: 2 to 20 Max</td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n	Learn how to cook Khmer cuisine and enjoy the great taste	data:image/jpeg;base64,	cooking-class-phnom-penh	1	23		20160801215329618023-Cooking-Class-Phnom-Penh-Tour_1.png$$$$$20160801215329618023-phnom-penh2-cooking-class.jpg	1	2016-08-01 21:53:29.537702	1
1	DISCOVER PHNOM PENH	<p>This is a popular half-day tour of Phnom Penh by tuktuk in which we visit all the major sites of the city. Our tourguides will give you information about the city&#39;s culture, religion, history, and contemporary lifestyle. We visit Central market, several important Buddhist sites, the riverside and Royal Palace. We end the tour at Smallworld, a grassroots startup and creative community center</p>\r\n\r\n<table border="0" cellpadding="5" cellspacing="5" style="height:83px; width:100%">\r\n\t<thead>\r\n\t\t<tr>\r\n\t\t\t<th scope="col">Itinerary</th>\r\n\t\t\t<th scope="col">Trip info</th>\r\n\t\t</tr>\r\n\t</thead>\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td>5:00- 6:30PM:</td>\r\n\t\t\t<td>Depart back to hotel.</td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n	Discovery Phnom Penh within half a day, understand the culture, religion and life style	data:image/jpeg;base64,	discover-phnom-penh	1	35		20160801214044837191-IMG_1137.JPG$$$$$20160801214044837191-IMG_1135.JPG$$$$$20160801214044837191-IMG_1127.JPG$$$$$20160801214044837191-IMG_1119.JPG	1	2016-08-01 21:40:44.72866	2
8	FAMILY TRIP ADVENTURE 11 DAYS	<p>This is an 11 day family-friendly education and adventure tour that allows you to see the beautiful eastern part of Cambodia and immerse yourself in local Cambodian culture. This is an active trip where we bike or trek everyday -- your family can exercise, have fun, and see the Cambodian countryside up close. We start with a daytrip to the tour host&#39;s home island, Widow&#39;s Island, an hour from Phnom Penh. We learn about recent Cambodian history and the ways it affects contemporary culture. Then we drive to Kratie, home of the famous Cambodian dolphin. Then we bike to Stung Treng for one-night homestay, where families can learn about how everyday Cambodians live. Next we will bike from Stung Treng to Rattanakiri, where we explore the beautiful jungle through trekking, visit a waterfall, and tour of a small town home to many people of Cambodian ethnic minority groups. This tour is more than just a cycling trip. Our highly educated tour guides will share their knowledge of the country and all of their life experiences with you and your children. We hope that this tour can help educate your children to love simple things, to appreciate what they have, to learn how to respect nature and other people. This trip allows your family to exercise and adventure safely. Though we bike everyday, we always have a support truck with us to carry supplies and to take a break when necessary.</p>\r\n\r\n<table border="0" cellpadding="5" cellspacing="5" style="height:15px; width:100%">\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td><strong>Elements</strong></td>\r\n\t\t\t<td>&nbsp;</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>Home- Stays:</td>\r\n\t\t\t<td>It is a challenging experience for a family to live with others in a completely different culture. The home-stays are remote, and the host family has limited English. Its amazing how much can be communicated through smiles. You can expect to be treated as members of your host family, and to learn a few words in Khmer.</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td><strong>Itinerary</strong></td>\r\n\t\t\t<td>&nbsp;</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>DAY 1: Orientation Day</td>\r\n\t\t\t<td>We will pick you up at your hotel,and we will travel all together to visit one remote island on the Basac river. It is about 37km south of Phnom Penh. We will enjoy our time there for an afternoon,and having lunch with the local host family. We will travel around the island to see how the local lives and their lifestyle.</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>DAY 2: Traveling to Kratie</td>\r\n\t\t\t<td>After breakfast,we will travel by our private minivan to Kratie. We will cross the ferry to Koh Trong, an island on the mekong river. We will cycling 3km to the home stay. There, we will meet our host family, and stay with them over 2 night with the local. We will have a chance to learn some traditional Khmer foods, help them cooking and enjoy foods together. After, we will hearing about Cambodian way of life from our local people. This is the interesting part to learn about.</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>DAY 3: Cycling</td>\r\n\t\t\t<td>We will leave from the host family early in order to start the journey to Opong Meon. We will stay overnight with the local host family at Opong Meon!</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>DAY 4: Cycling to Ratanakiri</td>\r\n\t\t\t<td>We will say goodbye to our host family and heading to Ratanakiri. It is much fun and difficult at the same time. We will need to cycle up and down hills. However,it is the best and exciting moment when we go down hills. We can cycle as much as you wish,and do not worry there is always a support minivan for you!</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>DAY 5: Enjoy Banlung</td>\r\n\t\t\t<td>We will cycling to YakLom lake and be laze on a hammock and eat like a locals. We will also do cycling around the Yak Lom Lake to see the beauty of the lake. After we can swim and enjoy the evening.</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>DAY 7: Short Adventure</td>\r\n\t\t\t<td>Explore the Mondulkiri town, it is know as a little Cambodian Switzerland. We will visit waterfalls,ride elephants and do a service project and clean up at the waterfall. We want to set as a good example for the locals and foreigners that environment is very importance.</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>DAY 9: Trekking day</td>\r\n\t\t\t<td>We might have missed our bike that we did not cycling for a day! We will cycling to visit the Bou Sra waterfall. It is one of the beautiful waterfall of Mondulkiri. On the way to the waterfall,we will stop by at the coffee farm and explore the farm,try the coffee before enjoying the day by swimming and relax at the waterfall.</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<p>DAY 11: Travelling</p>\r\n\t\t\t</td>\r\n\t\t\t<td>We have one morning to enjoy the town,shopping, then we will heading back to Phnom Penh by our minivan, We will have our bye bye dinner in Phnom Penh!</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td><strong>Trip Info</strong></td>\r\n\t\t\t<td>&nbsp;</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>Includes</td>\r\n\t\t\t<td><br />\r\n\t\t\t- Accommodation 10 nights<br />\r\n\t\t\t- Foods during trip<br />\r\n\t\t\t- All transportations during trip<br />\r\n\t\t\t- Pick up and drop of at the airport<br />\r\n\t\t\t- Services of the Tour leaders from first day to the last day of the tour<br />\r\n\t\t\t- All admission fees</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>&nbsp;</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>Exclude</td>\r\n\t\t\t<td>- Insurance<br />\r\n\t\t\t- Alcohol and drink<br />\r\n\t\t\t- International Flight tickets<br />\r\n\t\t\t- Personal expense<br />\r\n\t\t\t- Tips<br />\r\n\t\t\t- Visa fee</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>Participants</td>\r\n\t\t\t<td>Minimum of 3</td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n	Adventure with your children let them step out of comfort zone, interact with locals	data:image/jpeg;base64,	family-trip-adventure-11-days	2	1480		20160801222140697097-IMG_1920.jpg$$$$$20160801222140697097-homestay-3.png	1	2016-08-01 22:21:40.509084	3
7	DEVELOPMENT AND CULTURE PROGRAM - 17 DAYS  	<p>This 17-day tour is an exciting and thorough introduction to both contemporary and historical Cambodia. We learn about ancient history at the Angkor temples, witness the more recent, dark history through visits to the genocide memorials, explore the beautiful natural environment in Kampot, and see how everyday Cambodians live through authentic home-stays in Kandal province. We start in Phnom Penh visiting the architectural highlights of the city. We will then learn about the Khmer Rouge genocide, which ended in 1979, through visits to the memorial sites of Choeung Ek Killing Fields and Tuol Sleng Prison. We will then travel to Siem Reap to see the stunning Angkor complex and visit the beautiful floating villages of Lake Tonle Sap. Then we will visit the &quot;little-big&quot; town of Battambang to do an exchange program with Cambodian students and go for a cycling trip to explore the countryside. The second half of the trip begins with a three day homestay at the Koh Ksach Tunlea&rsquo;s island on the Bassac river in Kandal province. Here students will live with Khmer families, cook together with them over wood fires, speak Khmer with home-stay siblings, do chores such as harvesting mangoes and washing cows, cut the grass for the cows, and go to their homestay families&#39; farms. The journey will end in a beautiful southern province of Cambodia called Kampot, home of the famous Kampot pepper. Here students explore the natural beauty of the province&#39;s rivers and mangroves. Students will also learn about local people&#39;s protection and activism for the traditional fishing industry and mangrove forest.</p>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table border="0" cellpadding="5" cellspacing="5" style="width:100%">\r\n\t<thead>\r\n\t\t<tr>\r\n\t\t\t<th scope="col">\r\n\t\t\t<p>&nbsp;</p>\r\n\r\n\t\t\t<p>Elements</p>\r\n\t\t\t</th>\r\n\t\t\t<th scope="col">&nbsp;</th>\r\n\t\t</tr>\r\n\t</thead>\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\