over at the temple.</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>Day 5</td>\r\n\t\t\t<td>Floating village where a group of people living the life on the river. Observe and learn about health and hygiene, and environment issue.</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>Day 6</td>\r\n\t\t\t<td>Travel to Battambang. Students can have time on your own and explore Battambang for the afternoon.</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>Day 7</td>\r\n\t\t\t<td>Visit the responsible organization and learn about Orphanage tourism, visit the cave, bamboo train afterward.</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>Day 8</td>\r\n\t\t\t<td>Exchange program with local Battambang students, a cycling tour to witness the real countryside with the local students.</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>Day 9</td>\r\n\t\t\t<td>Travel to Phnom Penh. Sort Phnom Penh sightseeing. Take an easy afternoon after a long travel.</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>Day 10</td>\r\n\t\t\t<td>Travel Koh Ksach Tunlea for the homestay</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>Day 11</td>\r\n\t\t\t<td>Homestay with local host family</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>Day 12</td>\r\n\t\t\t<td>Homestay</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>Day 13</td>\r\n\t\t\t<td>Homestay</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>Day 14</td>\r\n\t\t\t<td>Travel to Kampot, enjoy the beauty of Kampot river. Relax and then learning from the community and enjoy the very tasty dinner that cooked by the community.</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>Day 15</td>\r\n\t\t\t<td>Visiting the Kampot pepper farm, secret lake, and a day trip to Kep</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>Day 16</td>\r\n\t\t\t<td>Kampot and depart for Phnom Penh in the afternoon, Last dinner, memories sharing, feedback and reflection.</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>Day 17</td>\r\n\t\t\t<td>Flight back home</td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n	Extensive introduction to Khmer history, geography, culture & development	data:image/jpeg;base64,	development-and-culture-program-17-days	2	1275	<iframe src="https://www.google.com/maps/embed?pb=!1m18!1m12!1m3!1d2378088.63930056!2d104.13969860451495!3d11.785088029727637!2m3!1f0!2f0!3f0!3m2!1i1024!2i768!4f13.1!3m3!1m2!1s0x310787bfd4dc3743%3A0xe4b7bfe089f41253!2sCambodia!5e0!3m2!1sen!2skh!4v1470123113497" width="600" height="450" frameborder="0" style="border:0;" allowfullscreen ></iframe>	20160801220955000170-IMG_3179.JPG$$$$$20160801220955000170-IMG_3168.JPG$$$$$20160801220955000170-feature-01_1.jpg$$$$$20160801220955000170-IMG_2319_okRmv11.JPG$$$$$20160801220955000170-IMG_3098.JPG	1	2016-08-01 22:09:54.323065	8
4	THEATER AND PERFORMANCE PHNOM PENH TOUR  	<p>We arrange tickets to the Cambodian Living Arts performance of traditional Khmer dance at the National Museum, running from 7-8 Monday, Wednesday, Friday and Saturday. We can help arrange transportation to the show as requested.</p>\r\n\r\n<table border="0" cellpadding="1" cellspacing="1" style="width:100%">\r\n\t<thead>\r\n\t\t<tr>\r\n\t\t\t<th scope="col">Tour info</th>\r\n\t\t\t<th scope="col">&nbsp;</th>\r\n\t\t</tr>\r\n\t</thead>\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td>Place</td>\r\n\t\t\t<td><br />\r\n\t\t\t- Place: At National Museum<br />\r\n\t\t\t- Duration: 1h30min<br />\r\n\t\t\t&nbsp;</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>&nbsp;</td>\r\n\t\t\t<td>&nbsp;</td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n	Enjoy the beautiful performance by Cambodian Living Art, Immerse the great culture of Cambodia	data:image/jpeg;base64,	theater-and-performance-phnom-penh-tour	1	22		20160801215620465543-kh-living-art.jpg$$$$$20160801215620465543-theaterperformance.png	1	2016-08-01 21:56:20.37393	3
2	ADVENTURE TO PHNOM BASETH & PHNOM OUDONG	<p>In this tour we cycle on a dirt road trail to explore the real beauty of Cambodia. Along the way, we will visit Phnom Reap, a mountain which is being taken apart to make cement, and discuss the sometimes dark side of development. Then we visit Oudong where lies the northwest of Phnom Penh at the base of a beautiful mountain topped with many stupas. Oudong was the capital of Cambodia from 1618 to 1866 located 40 km north of Phnom Penh. During the tour, we will hike to the top of the mountain and see the beautiful views of the surrounding countryside and the ancient architecture. The tourguides will explain the history of the old city. We then bike back together to Phnom Penh. This tour is for athletic adventurers and requires about a ~100km bike ride and a small hike to the top of the mountain.</p>\r\n\r\n<table border="0" cellpadding="1" cellspacing="1" style="width:100%">\r\n\t<thead>\r\n\t\t<tr>\r\n\t\t\t<th scope="col">Tour info</th>\r\n\t\t\t<th scope="col">&nbsp;</th>\r\n\t\t</tr>\r\n\t</thead>\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td>Participants</td>\r\n\t\t\t<td><br />\r\n\t\t\t- Distance: 100 km round trip<br />\r\n\t\t\t- Participant: 2 to 12 Max</td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n	ADVENTURE TO PHNOM BASETH & PHNOM OUDONG	data:image/jpeg;base64,	adventure-to-phnom-baseth-phnom-oudong	1	35		20160801214940768195-Phnom-Oudong.jpg$$$$$20160801214940768195-Av9f3OB5m-VdFKQ_cZ8gx0FoKtI0PBHIs2Q28mzILm5o.jpg$$$$$20160801214940768195-Adventure-to-Phnom-Baseth--Phnom-Oudong-.png	1	2016-08-01 21:49:40.695678	3
10	LEADERSHIP PROGRAM	<p>This 14-day tour gives students the opportunity to learn about Cambodian history and culture while visiting the most beautiful sites in the country: Phnom Penh, Kampot, Battambang, and Siem Reap. Students arrive in Phnom Penh, the capital city of the kingdom, where we will settle for few days to visit important sites that will help us understand the unique culture of Cambodia. We will visit the Royal Palace and Silver Pagoda, experience the traditional blessings from the local monks, and learn about the dark period of Cambodia&#39;s history. The program then takes participants to experience contemporary life in a local community through a homestay. At the Koh Ksach Tunlea Island (&quot;A Widow Island&quot;), we have a chance to learn more about Cambodia&rsquo;s history directly from our hosts who are recovering from the war that killed so many educated people. Participants will have a chance to interact directly with the locals, and spend the time learning about their daily lives. Food will be cooked in the traditional way and we will eat like locals. We will practice the Khmer language with our homestay families and participate in daily life with activities such as farming, cutting the grass for cows, feeding animals, fishing, and harvesting vegetables and fruit. Next we head south to Kampot, a charming quiet town on a river near the sea. The province is famous for Kampot pepper and seafood. We will visit a fishing community and help to plant mangroves in an effort to restore fish habitat. Here we will learn more about environmental issues facing coastal Cambodia. Our journey takes us next to the west part of Cambodia, to Battambang, the city of art. Here we will discover the contemporary art movement and its importance in restoring cultural heritage. We will also learn about Cambodian agriculture and mining in Battambang. Siem Reap, home of the Angkor temples, is our last stop. Here we will learn about ancient Cambodian history by visiting temples and other historic sites. Also in Siem Reap we will learn about other environmental issues as we visit Tonle Sap, the giant lake connected to the Mekong River which is the breeding ground for a majority of the fish that provide food for Cambodia and Vietnam.</p>\r\n\r\n<table cellpadding="5" cellspacing="5" style="width:100%">\r\n\t<thead>\r\n\t\t<tr>\r\n\t\t\t<th scope="col">Program Info</th>\r\n\t\t\t<th scope="col">&nbsp;</th>\r\n\t\t</tr>\r\n\t</thead>\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td>Home&shy; Stays:</td>\r\n\t\t\t<td><br />\r\n\t\t\tIt is a challenging experience for the students. 2 to 3 students will live with one host family, where they interact directly with their host, practice their Khmer language, and where students can expect to be treated as members of the family.<br />\r\n\t\t\t&nbsp;</td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table border="0" cellpadding="5" cellspacing="5" style="width:100%">\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td><strong>Elements</strong></td>\r\n\t\t\t<td>&nbsp;</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<p>Home&shy; Stays:</p>\r\n\t\t\t</td>\r\n\t\t\t<td>\r\n\t\t\t<p>It is a challenging experience for the students. 2 to 3 students will live with one host family, where they interact directly with their host, practice their Khmer language, and where students can expect to be treated as members of the family.</p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n\r\n<table border="0" cellpadding="5" cellspacing="5" style="width:100%">\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td><strong>Itinerary</strong></td>\r\n\t\t\t<td>&nbsp;</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<p>Day 1: Arrive to Phnom Penh</p>\r\n\t\t\t</td>\r\n\t\t\t<td>\r\n\t\t\t<p>We will come and pick you up at the airport and help check you in at the hotel, where there will be a welcome dinner.</p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<p>Day 2: Orientation day</p>\r\n\t\t\t</td>\r\n\t\t\t<td>\r\n\t\t\t<p>After a group breakfast, we will go to Smallworld. We will have an orientation where we get to know each other better, and we give you a basic introduction to the culture; &quot;Do&rsquo;s and Don&#39;ts&quot;, how to travel safe, money, transportation, communication, food safety, basic Khmer lessons, and daily schedule. After orientation, you will get a tour of Smallworld, and the staff will introduce their social enterprises and new start up companies under Smallworld, and tell us about their work. We will have lunch at a local restaurant, and taste the local Cambodian food. After lunch we will have a tour of the city, which will include visiting Wat Phnom, the Royal Palace, Silver Pagoda, and more general sightseeing. We will return to the hotel for a group dinner.</p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<p>Day 3:Discussion on the dark period of Cambodia</p>\r\n\t\t\t</td>\r\n\t\t\t<td>\r\n\t\t\t<p>Breakfast ,Visit Toul Sleng Museum, and Killing Fields, discussion about the dark period of Cambodia history. Refresh our spirits with a sunset boat trip on the Mekong.</p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<p>Day 4: Discussion on the dark period of Cambodia</p>\r\n\r\n\t\t\t<p>&nbsp;</p>\r\n\t\t\t</td>\r\n\t\t\t<td>Breakfast ,Visit Toul Sleng Museum, and Killing Fields, discussion about the dark period of Cambodia history. Refresh our spirits with a sunset boat trip on the Mekong.</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<p>Day 5: Homestay</p>\r\n\r\n\t\t\t<p>&nbsp;</p>\r\n\t\t\t</td>\r\n\t\t\t<td>You will have the morning to interact with the host family, learn how to cook and exchange of the culture and share the daily life experience between your home country and the host. Farewell dinner with the host before departing for Kampot.</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<p>Day 6: Kampot</p>\r\n\t\t\t</td>\r\n\t\t\t<td>\r\n\t\t\t<p>It is about 4 hours from the homstay to Kampot province. Check in at the Eco resort located right in front of Kampot river. Town exploring in the afternoon and dinner in town.</p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<p>Day 7: Environmental service project</p>\r\n\t\t\t</td>\r\n\t\t\t<td>\r\n\t\t\t<p>After breakfast, we will depart to the fishery community. Learn more about the organization, and help with the service project by planting the mangroves and joining community members for lunch.</p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<p>Day 8: Travel to Battambang</p>\r\n\t\t\t</td>\r\n\t\t\t<td>\r\n\t\t\t<p>Today will be a long bus ride from Kampot to Battambang. In the afternoon, check in to the hotel, relax and dinner in town.</p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<p>Day 9: Pailin, Mining</p>\r\n\t\t\t</td>\r\n\t\t\t<td>\r\n\t\t\t<p>Pailin is the smallest province in Cambodia, with a population of just over 20,000 people. In the 1970s, Pailin was a prosperous town, because of its extensive gem deposits. Because of these precious stones, it was one of the first cities invaded by the Khmer Rouge and was under their control until 1997. Learn about the destructive mining and logging practices that have led to great environmental damage in the area and how the residents are managing the aftermath. We will visit past commercial mining sites that have negatively impacted farming, and learn how villagers have converted forest to farming land. On the way back, visit Phnom Sompov.</p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<p>Day 10: Rural Cambodia Exploration</p>\r\n\t\t\t</td>\r\n\t\t\t<td>\r\n\t\t\t<p>Battabang city tour and learning about social local enterprise. Return to lunch at Accent house. Free evening to explore town on your own.</p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<p>Day 11: Travel to Siem Reap</p>\r\n\t\t\t</td>\r\n\t\t\t<td>\r\n\t\t\t<p>The drive from Battambang to Siem Reap is approximately 3 &frac12; hours, including bathroom and snack breaks. We will stop for lunch at a local restaurant in Kralanh District. On the way to Siem Reap, will visit Silk Farm, learn more on how silk is being produced. Check in to hotel and in the afternoon, town exploration.</p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<p>Day 12: Ancient Temples and Historical day</p>\r\n\t\t\t</td>\r\n\t\t\t<td>\r\n\t\t\t<p>Temple Visits, Angkor Wat, Bayon, Lunch at the temple complex. After Lunch visit Ta Prohm temples. learn more about the history of the Angkor empire back in the old day. In the late afternoon back to town.</p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<p>Day 13: Source of Life: The Tonle Sap</p>\r\n\t\t\t</td>\r\n\t\t\t<td>\r\n\t\t\t<p>Visit the Tonle Sap and we will discuss the historical and current importance of the lake, culturally and economically, as well as the environmental and developmental challenges that the government and many NGOs are seeking to address. In particular, we will discuss environmental issues, such as the impact of climate change on fisheries, declining biodiversity, and human pressures put on the lake&rsquo;s ecosystem. We will also discuss social issues, such as challenges to livelihoods and food security, and clean water.</p>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t\t<tr>\r\n\t\t\t<td>\r\n\t\t\t<p>Day 14: Packing and Evaluation</p>\r\n\t\t\t</td>\r\n\t\t\t<td>\r\n\t\t\t<p>You will have a free morning to shop for gifts and souvenirs. In the afternoon, we will discuss the program and what you learned in small groups and then share highlights with the whole group final packing and the last farewell dinner before departing.</p>\r\n\r\n\t\t\t<table>\r\n\t\t\t\t<tbody>\r\n\t\t\t\t</tbody>\r\n\t\t\t</table>\r\n\t\t\t</td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n	Culture immersion and Cambodia's study for high school and University students	data:image/jpeg;base64,	leadership-program	2	1350		20160810192711672159-homestay_7fEMTlc.jpg$$$$$20160810192711672159-IMG_7832.jpg$$$$$20160810192711672159-leadership-18.jpg$$$$$20160810192711672159-streetfood1.jpg$$$$$20160810192711672159-service_project1_bVfmBij.jpg	1	2016-08-10 18:49:32.495966	1
5	BOAT CRUISE PHNOM PENH TOUR  	<p>We offer in this tour a boat cruise of the Tonle Sap and Mekong river during sunset. This trip awards beautiful riverfront views of the Royal Palace, National Museum, and the skyline. We also will visit the floating village to see traditional fishing practices. This is a relaxing and fun way to spend an evening!</p>\r\n\r\n<table border="0" cellpadding="1" cellspacing="1" style="width:100%">\r\n\t<thead>\r\n\t\t<tr>\r\n\t\t\t<th scope="col">Tour info</th>\r\n\t\t\t<th scope="col">&nbsp;</th>\r\n\t\t</tr>\r\n\t</thead>\r\n\t<tbody>\r\n\t\t<tr>\r\n\t\t\t<td>Participant</td>\r\n\t\t\t<td>2 to 20 Max</td>\r\n\t\t</tr>\r\n\t</tbody>\r\n</table>\r\n\r\n<p>&nbsp;</p>\r\n	Relax on the boat cruise, watch sunset of Phnom Penh on Mekong river	data:image/jpeg;base64,	boat-cruise-phnom-penh-tour	1	10		20160801215835421123-boat1.jpg$$$$$20160801215835421123-boat.jpg	1	2016-08-01 21:58:35.364224	5
